    true,nt"url": null,nt"notes": "With the SFTool API, you can access a myriad
    of high performance building information. Pull the most up to date information about
    green products, services, and materials. Put sustainable strategies in the hands
    of your audience today. All of our API methods are HTTP GET and always return the
    latest data. Whether youu2019re looking to add sustainable building information
    to your website or blog, or looking for data to build an application, the SFTool
    API is here for you.Making API calls is very straightforward. There is a single
    base URI for each data category. By default, it will return all of the data for
    that category. By using any of our optional parameters, you can filter the data
    as you see fit. Signup for free to get the SFTool API key at  https://api.data.gov/signup/.",nt"license_title":
